import React from 'react';
import { Link } from 'react-router-dom';

function Deposit(){
    return (
        <div className='container'>
            <div className='row'>
                <h1>Deposit</h1>
                <div className='blance'>
                    $ 50.00
                </div>
            </div>
            <div className='row'>
                <div className='link-btn'>
                    <Link to='/home'>Back</Link>
                </div>
            </div>
        </div>
    )
}


export default Deposit;
